import React, { Component } from "react";
import { withRouter } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { registerUser } from "../../actions/authActions";
import classnames from "classnames";
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import FormControl from '@material-ui/core/FormControl';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import LockIcon from '@material-ui/icons/LockOutlined';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';

import axios from 'axios';

class Register extends Component {
  constructor() {
    super();
    this.state = {
      name: "",
      email: "",
      cles: "",
      password: "",
      password2: "",
      errors: {},
      persons: []
    };
  }

  componentDidMount() {
    axios.get(`http://localhost:5000/api/users/entreprise`)
      .then(res => {
        const persons = res.data;
        console.log("ity ny get entreprise lesy dada ah " + persons)
        this.setState({ persons });
      })
    // If logged in and user navigates to Register page, should redirect them to dashboard
    if (this.props.auth.isAuthenticated) {
      this.props.history.push("/dashboard");
    }
  }

  componentWillReceiveProps(nextProps) {
    if (nextProps.errors) {
      this.setState({
        errors: nextProps.errors
      });
    }
  }

  onChange = e => {
    this.setState({ [e.target.name]: e.target.value });
  };

  onSubmit = e => {
    e.preventDefault();

    const newUser = {
      name: this.state.name,
      email: this.state.email,
      cles: this.state.cles,
      password: this.state.password,
      password2: this.state.password2
    };

    this.props.registerUser(newUser, this.props.history);
  };

  render() {
    const { errors } = this.state;

    return (
      <div className="container">
        <React.Fragment>
        <CssBaseline />
        <main className="layout">
          <Paper className="paper">
            <Avatar className="avatar">
              <LockIcon />
            </Avatar>
            <Typography variant="headline">Sign Up</Typography>
            <form onSubmit={this.handleSubmit} noValidate>
              <FormControl margin="normal" required fullWidth>
                <InputLabel htmlFor="name">Name</InputLabel>
                <Input
                  onChange={this.handleInputChange}
                  id="name"
                  name="name"
                  autoComplete="name"
                  autoFocus
                  error={!!errors.name}
                />
                <span className="errorText">{errors.name}</span>
              </FormControl>
              <FormControl margin="normal" required fullWidth>
                <InputLabel htmlFor="email">adresse exacte</InputLabel>
                <Input
                  onChange={this.handleInputChange}
                  id="adresse_exacte"
                  name="adresse_exacte"
                  autoComplete="adresse_exacte"
                  error={!!errors.email}
                />
                <span className="errorText">{errors.email}</span>
              </FormControl>
              <FormControl margin="normal" required fullWidth>
                <InputLabel htmlFor="email">Email Address</InputLabel>
                <Input
                  onChange={this.handleInputChange}
                  id="email"
                  name="email"
                  autoComplete="email"
                  error={!!errors.email}
                />
                <span className="errorText">{errors.email}</span>
              </FormControl>
              <FormControl margin="normal" required fullWidth>
                <InputLabel htmlFor="password">Password</InputLabel>
                <Input
                  onChange={this.handleInputChange}
                  name="password"
                  type="password"
                  id="password"
                  autoComplete="current-password"
                  error={!!errors.password}
                />
                <span className="errorText">{errors.password}</span>
              </FormControl>
              <FormControl margin="normal" required fullWidth>
                <InputLabel htmlFor="password">Confirm Password</InputLabel>
                <Input
                  onChange={this.handleInputChange}
                  name="passwordConfirm"
                  type="password"
                  id="passwordConfirm"
                  autoComplete="current-password-confirm"
                  error={!!errors.passwordConfirm}
                />
                <span className="errorText">
                  {errors.passwordConfirm || errors.error}
                </span>
              </FormControl>
              <Button
                type="submit"
                fullWidth
                variant="raised"
                color="primary"
                className="submit"
              >
                Create Account
              </Button>
            </form>
            <Typography className="footer" variant="body1">
              {'Already have an account? '}
              <NavLink to="/clientLogin" className="link">
                Log In
              </NavLink>
            </Typography>
          </Paper>
        </main>
      </React.Fragment>
        <div className="row">
          <div id="register">
            <form noValidate onSubmit={this.onSubmit}>
              <label htmlFor="name">Name</label>
              <br />
              <input

                id="inputFileRegister"
                onChange={this.onChange}
                value={this.state.name}
                error={errors.name}
                name="name"
                type="text"
                className={classnames("", {
                  invalid: errors.name
                })}
              />
              <br />
              <span className="red-text">{errors.name}</span>
              <br />
              <label htmlFor="email">Email</label>
              <br />
              <input
                id="inputFileRegister"
                onChange={this.onChange}
                value={this.state.email}
                error={errors.email}
                name="email"
                type="email"
                className={classnames("", {
                  invalid: errors.email
                })}
              />
              <br />
              <span className="red-text">{errors.email}</span>
              <br />


              <label htmlFor="cles">Cles</label>
              <br />
              <input
                id="inputFileRegister"
                onChange={this.onChange}
                value={this.state.cles}
                error={errors.cles}
                name="cles"
                type="password"
                className={classnames("", {
                  invalid: errors.cles
                })}
              />
              <br />
              <span className="red-text">{errors.cles}</span>
              <br />

              <label htmlFor="password">Password</label>
              <br />
              <input
                id="inputFileRegister"
                onChange={this.onChange}
                value={this.state.password}
                error={errors.password}
                name="password"
                type="password"
                className={classnames("", {
                  invalid: errors.password
                })}
              />
              <br />
              <span className="red-text">{errors.password}</span>
              <br />
              <label htmlFor="password2">Confirm Password</label>
              <br />
              <input
                id="inputFileRegister"
                onChange={this.onChange}
                value={this.state.password2}
                error={errors.password2}
                name="password2"
                type="password"
                className={classnames("", {
                  invalid: errors.password2
                })}
              />
              <br />
              <span className="red-text">{errors.password2}</span>
              <br />
              <button
                style={{
                  width: "150px",
                  borderRadius: "3px",
                  letterSpacing: "1.5px",
                  marginTop: "1rem"
                }}
                type="submit"
                id="buttonLogin"
              >
                S'inscrire
                </button>
            </form>
          </div>
        </div>
      </div>
    );
  }
}

Register.propTypes = {
  registerUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  errors: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
  auth: state.auth,
  errors: state.errors
});

